import styled from 'styled-components';
import { BiCartAlt } from 'react-icons/bi';

export const Container = styled.div`
    position: absolute;
    background-color: var(--primary);
    padding: 10px;
    display: flex;
    align-items: center;
    color: #fff;
    right: 0;
    top: 35%;
`;

export const Cart = styled(BiCartAlt)`
`;
